import React,{useRef} from 'react';
import './register.scss';
import { Link } from 'react-router-dom';
function Register() {

  const username = useRef();
  const email = useRef();
  const password = useRef();
  const passwordAgain = useRef();



  const handleClick =(e) => {
    e.preventDefault();

  };


  return (
    <div className='register' >
        <div className="register_Container">
            <img src="Assets/Panda_Social_logo.png" alt="" />


            <form className='register_box'>
              <input type="text" required ref = {username} placeholder='Username'/>
              <input type="email" required ref = {email} placeholder='Email'/>
              <input type="password" required ref = {password} minLength ="6" placeholder='Password'/>
              <input type="password_again" required ref = {passwordAgain} placeholder='Password Again'/>

              <button className='home_register'>Register a new account</button>


            </form>


            <Link to = '/signin'>
            <p className='register_back'>Back to Sign in</p>

            </Link>
        </div>

    </div>
  )
}

export default Register
